var ComponentsClipboard={init:function(){var t;$(".mt-clipboard").each(function(){new Clipboard(this).on("success",function(o){t=o.text,console.log(t)})}),$(".mt-clipboard").click(function(){if(1==$(this).data("clipboard-paste"))if(t){var o=$(this).data("paste-target");$(o).val(t),$(o).html(t)}else alert("No text was copied or cut.")})}};jQuery(document).ready(function(){ComponentsClipboard.init()});